/*
 * Surveys Messages
 *
 * This contains all the text for the Surveys container.
 */

import { defineMessages } from 'react-intl';

export const scope = 'app.containers.Surveys';

export default defineMessages({
  allTime: {
    id: `${scope}.allTime`,
    defaultMessage: 'All Time',
  },
  average: {
    id: `${scope}.average`,
    defaultMessage: 'Average',
  },
  answeredQuestion: {
    id: `${scope}.answeredQuestion`,
    defaultMessage: 'answered this question',
  },
  availableContexts: {
    id: `${scope}.availableContexts`,
    defaultMessage: 'Languages',
  },
  communities: {
    id: `${scope}.communities`,
    defaultMessage: 'All Communities',
  },
  dateRange: {
    id: `${scope}.dateRange`,
    defaultMessage: 'Date Range',
  },
  dataFrom: {
    id: `${scope}.dataFrom`,
    defaultMessage: 'Data From...',
  },
  lastUpdate: {
    id: `${scope}.lastUpdate`,
    defaultMessage: 'Last Update',
  },
  lastSubmission: {
    id: `${scope}.lastSubmission`,
    defaultMessage: 'Last Submission',
  },
  name: {
    id: `${scope}.name`,
    defaultMessage: 'Survey Template',
  },
  median: {
    id: `${scope}.median`,
    defaultMessage: 'Median',
  },
  minimum: {
    id: `${scope}.minimum`,
    defaultMessage: 'Minimum',
  },
  maximum: {
    id: `${scope}.maximum`,
    defaultMessage: 'Maximum',
  },
  outOf: {
    id: `${scope}.outOf`,
    defaultMessage: 'out of',
  },
  questionsCount: {
    id: `${scope}.questionsCount`,
    defaultMessage: 'Questions',
  },
  response: {
    id: `${scope}.response`,
    defaultMessage: 'Response',
  },
  responses: {
    id: `${scope}.responses`,
    defaultMessage: 'Responses',
  },
  submissionsCount: {
    id: `${scope}.submissionsCount`,
    defaultMessage: 'Submissions',
  },
  surveyListHeader: {
    id: `${scope}.surveyListHeader`,
    defaultMessage: 'Survey Templates',
  },
  viewFamily: {
    id: `${scope}.viewFamily`,
    defaultMessage: 'View Family',
  },
  submissionListHeader: {
    id: `${scope}.submissionListHeader`,
    defaultMessage: 'Submissions',
  },
  viewSubmission: {
    id: `${scope}.viewSubmission`,
    defaultMessage: 'View Submissiom',
  },
});
